import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import JiraManagerPro from "./project";
import AnalyticsDashboard from "./AnalyticsDashboard";

function App() {
  return (
    <div className="min-h-screen bg-gray-100">
      {/* Top Nav */}
      <nav className="bg-white shadow px-6 py-4 flex gap-6">
        <Link to="/" className="font-medium text-blue-600 hover:underline">Tickets</Link>
        <Link to="/analytics" className="font-medium text-blue-600 hover:underline">Analytics</Link>
      </nav>

      {/* Routes */}
      <Routes>
        <Route path="/" element={<JiraManagerPro />} />
        <Route path="/analytics" element={<AnalyticsDashboard />} />
      </Routes>
    </div>
  );
}

export default App;
